import React, { Component } from 'react';
import { connect } from 'react-redux';



class ArtPage extends Component {
    // Renders the entire app on the DOM


    render() {
      console.log('this is a clear page with clear objectives');


        return (

           <div>
                <div></div>
                <img></img>
                <button>RENTED</button>
                <button> DELETE </button>
                <ul>
                    <li>{this.props.classes.cardText}>Size: {artwork}</li>
                    <li>{this.props.classes.cardText}>Description: {p.subfamily}</li>
                   <li>{this.props.classes.cardText}>Prominent Coloring: {p.clade}</li>
                   <li>{this.props.classes.cardText}>Style: {p.order}</li>
                   <li>{this.props.classes.cardText}>Price: {p.family}</li>
                   <li>{this.props.classes.cardText}>Description: {p.subfamily}</li>

                </ul>
           </div>
        );
    }
}

const mapReduxStateToProps = (reduxState) => {
    return reduxState;
}


export default connect(mapReduxStateToProps)(ArtPage);
